INSERT INTO `posts` VALUES (1,'test1','test1','2016-05-09 11:41:25','2016-05-09 11:41:25',1),(2,'test2','test2','2016-05-09 11:42:07','2016-05-09 11:42:07',2),(3,'test3','test3','2016-05-09 11:42:35','2016-05-09 11:42:35',3),(4,'test4','TEST4','2016-05-09 11:43:17','2016-05-09 11:43:17',1),(5,'TEST5','TEST5','2016-05-09 11:44:00','2016-05-09 11:44:00',2),(6,'test6','test6','2016-05-09 11:44:31','2016-05-09 11:44:31',3),(7,'test7','test7','2016-05-09 11:45:01','2016-05-09 11:45:01',2),(8,'test8','test8','2016-05-09 11:45:12','2016-05-09 11:45:12',1),(9,'test9','test9','2016-05-09 11:45:24','2016-05-09 11:45:24',3),(10,'test10','test10','2016-05-09 11:45:43','2016-05-09 11:45:43',1),(11,'test11','test11','2016-05-09 11:45:59','2016-05-09 11:45:59',1),(12,'長文【Sample】','【１】昔の人々は、明るい星を結んで星座を思い描きました。星座を作ったのは、シュメール人という説もありますが、一般的には、約五千年前、バビロニアの羊飼いたちによって、作られたのが最初と言われています。\r\n\r\n【２】初めのころは、十二星座でしたが、その後、四十八星座に増えました。 \r\n十七世紀に、オランダで望遠鏡が発明され、暗い星も観測できるようになると、四十八星座のすきまにも新しい星座が作られるようになりました。\r\n\r\n【３】そのころ、星を見つけるたびに、こんな会話が交わされたかもしれません。「新しい星を見つけたぞ。」「だめ。それは、おらンダ。」 \r\nそれまでは、星座というと、北半球のものに限られていました。\r\n\r\n【４】しかし、今まで知られていなかった南半球の星座が紹介されるようになると、新星座作りのブームが起こりました。なぜ星座がたくさん作られたのかというと、二十世紀の初めまでは、星座を作ることに決まりがなく、誰でも簡単に作ることができたからです。【５】一時は百二十もの星座が作られたことがあり、あまりの多さに混乱が起きるようになってしまいました。そこで、二十世紀になってから、国際天文学連合によって、八十八の星座に統一され、星座の境界も定められることになりました。\r\n\r\n【６】現在、私たちが親しんでいる星座は、このときに定められたものです。 \r\n　星座は、神話とともに紹介されることが多いため、西洋のものと思われがちですが、古代のインドや中国にも独自のものがあります。\r\n\r\n【７】中国の星座は、七、八世紀ごろ、日本にも伝えられたようで、日本では、明治時代に西洋の天文学が導入されるまで、ずっと中国の星座が使われてきました。∵ \r\n\r\n【８】また、昔から星座は、時刻をはかり、季節の移り変わりを知り、農耕の時期を伝える役割を果たしてきました。海に囲まれた土地に住む人々は、広い海を航海するときに、星を観測して位置や方角を確かめるのにも使っていました。\r\n\r\n【９】ですから、星座の名前も、その土地独自の呼び名が数多くありました。 \r\n四季を通じて明るく見えるオリオン座は、世界各地でさまざまな名前がつけられています。日本では、その形から鼓星と呼ばれていました。\r\n\r\n【１０】また、オリオン座の左上にある赤い星は平家星、右下にある白い星は源氏星とも呼ばれていました。これは平家の旗の色が赤、源氏の旗の色が白だったからです。 \r\nさまざまな想像をふくらませてくれる星座を、たまには正座してしみじみ眺めてみるのもいいかもしれません。 \r\nあれは大きいからお父さん星。あっちはきれいだからお母さん星。これはしょっぱいから梅干し。ここにある長いのは物干し。頭にかぶっているのはただの帽子。 \r\n','2016-05-09 11:47:10','2016-05-09 15:48:16',2),(17,'adfsgdhfadsa','fwfre','2016-05-18 14:34:43','2016-05-18 14:34:43',1),(22,'aaaa','saaahd\r\njojojojojojojo\r\nkokokokokoj\r\nlololololololo\r\nuouououououo','2016-05-18 14:43:36','2016-05-18 15:10:40',1),(23,'TEST','テスと','2016-05-18 15:13:38','2016-05-18 15:13:38',3);
